import React from "react";
import logo from "../../assets/header/Logo-hb.svg";

import "./Header.css";

const Header = () => {
  return (
    <div className="header__container">
      <div>
        <img src={logo} className="logo" />
      </div>
    </div>
  );
};

export default Header;
